import {Route,Routes,useNavigate} from 'react-router-dom';
import NavBar from './NavBar'
import HomePage from './HomePage'
import UserPage from './UserPage'
import PageNotFound from './PageNotFound'
import LoginForm from './forms/LoginForm'
import SignUpForm from './forms/SignUpForm'
import NewBookForm from './forms/NewBookForm'



import axios from 'axios';
// import AddImageForm from '/.AddImageForm.js'
import './css/App.css';
import './fonts.css';

function App() {
 const navigate = useNavigate();
const signUp = async(data)=>{
  let res = await axios.post('/register',{...data,is_pro_user: true});
  console.log(res);
  navigate(`/`);
}

const login = async(data)=>{
  let res = await axios.post('/login',data);
  console.log(res);
  navigate(`/`);
}

  return (
    <>
      <NavBar/>
      <Routes>
          <Route exact="true" path='/' element={<HomePage/>}/>
          <Route exact="true" path='/login' element={<LoginForm login={login}/>}/>
          <Route exact="true" path='/signUp' element={<SignUpForm signUp={signUp}/>}/>

          <Route exact="true" path='/search/books' element={<SignUpForm signUp={signUp}/>}/>
          <Route exact="true" path='/search/libraries' element={<SignUpForm signUp={signUp}/>}/>
          <Route exact="true" path='/explore' element={<SignUpForm signUp={signUp}/>}/>
          <Route exact="true" path='/user/:username' element={<UserPage username={'testing'} firstName={'rose'} lastName={'powell'} />}/>
          <Route exact="true" path='/user/:username/libraries' element={<SignUpForm signUp={signUp}/>}/>
          <Route exact="true" path='/new/library' element={<SignUpForm signUp={signUp}/>}/>
          <Route exact="true" path='/new/book' element={<NewBookForm/>}/>
          <Route exact="true" path='/settings' element={<SignUpForm signUp={signUp}/>}/>

          <Route path="*" element={<PageNotFound/>} />
      </Routes>
  </>
  );
}

export default App;
